import React from "react";
import { Link, Outlet } from 'react-router-dom'
// import UseTable from "./hooks/useTable";
import { useNavigate } from 'react-router-dom'
import FormNew from './formNew'
// import axios from 'axios'

export const AddNewRecipe = () => {
    const navigate = useNavigate()
    return (
        <> 
        <Outlet>
        <button  className="btn btn-primary mt-2" variant="primary"><Link to='FindNew' className="text-decoration-none">Find for new recipes</Link></button>
        <button  className="btn btn-primary mt-2" variant="primary"><Link to='WriteNew' className="text-decoration-none">Write your on recipe</Link></button>


            <button className='Back'onClick={() => navigate(-1)}>Go back</button>
            </Outlet>
        </>
    )
}
